import "./index.css";
const Jokes = (props) => {
  const jokes = props;
  console.log(jokes.jokes);

  return (
    <li className="list-items">
      <p>{jokes.jokes.category}</p>
      <p>{jokes.jokes.type}</p>
      <p>{jokes.jokes.lang}</p>
      <p>{jokes.jokes.type}</p>
    </li>
  );
};
export default Jokes;
